import React from 'react'
import { Button } from '@material-ui/core'

export default class ListItem extends React.PureComponent{
    render() {
        return(
            <div style={{padding: '10px'}}>
                <Button variant="contained" color="secondary"  onClick = {this.props.removeOnClick}>{'X'}</Button>
                <Button style={{width: '20px'}} variant="contained" color="primary" onClick = {this.props.triggerFunction}>{this.props.text}</Button>
            </div>
        )
    }
}
